    if _ARG_0_ == UIEnums.Message.MouseClickInBox and UIButtons.GetType(_ARG_2_) == UIEnums.ButtonTypes.STATIC_SHAPE then
      if UIButtons.GetType((UIButtons.GetParent(_ARG_2_))) ~= UIEnums.ButtonTypes.NODE then
      end
      if UIButtons.GetType((UIButtons.GetParent((UIButtons.GetParent(_ARG_2_))))) == UIEnums.ButtonTypes.NODE then
        UIButtons.SetCurrentItemByID(GUI.car_node_list_id, (UIButtons.GetParent((UIButtons.GetParent(_ARG_2_)))))
