        end
      end
    end
    if _ARG_0_ == UIEnums.Message.MenuNext or UIEnums.Message.ButtonA == UIEnums.Message.ButtonA then
      if GarageMini_GetSelectedCar().own_it == true then
        if GUI.is_multiplayer == true then
          PlaySfxNext()
          Multiplayer.SetGarageCarByID(GarageMini_GetSelectedCar().id)
          Amax.LoadCar(GarageMini_GetSelectedCar().id, GUI.is_multiplayer)
          GarageMini_Back()
        else
          PlaySfxNext()
          GarageMini_LoadGame()
        end
      else
        PlaySfxError()
      end
    elseif _ARG_0_ == UIEnums.Message.MenuBack or UIEnums.Message.ButtonA == UIEnums.Message.ButtonB then
      PlaySfxBack()
      if GUI.old_diff ~= UIGlobals.OptionsTable.difficulty then
        print("Resetting Difficulty to ", GUI.old_diff)
        UIGlobals.OptionsTable.difficulty = GUI.old_diff
        Amax.Options(UIGlobals.OptionsTable)
        StartAsyncSave()
      end
      GarageMini_Back()
    elseif _ARG_0_ == UIEnums.Message.ButtonX or UIEnums.Message.ButtonA == UIEnums.Message.ButtonX then
      if GUI.enable_respray == false then
        return
      end
      if GarageMini_GetSelectedCar().own_it == true and GarageMini_GetSelectedCar().respray == true then
        PlaySfxNext()
        GarageMini_UpdateCurrentMode(GUI.mode.colour)
      end
    elseif _ARG_0_ == UIEnums.Message.ButtonY and GUI.is_sp_event == true then
      UIGlobals.OptionsTable = Amax.Options()
      SetupCustomPopup(UIEnums.CustomPopups.SpChangeDifficulty)
    end
  elseif GUI.current_mode == GUI.mode.colour then
    if _ARG_0_ == UIEnums.Message.MenuNext then
      if GarageMini_PaletteUnlocked() == true then
        UISystem.PlaySound(UIEnums.SoundEffect.GarageReSpray)
        GUI.save_on_exit = true
        GarageMini_RespraySetToProfile()
        GarageMini_UpdateCurrentMode(GUI.mode.car)
      else
        PlaySfxError()
      end
    elseif _ARG_0_ == UIEnums.Message.MenuBack then
      PlaySfxBack()
      GarageMini_RespraySetFromProfile()
      GarageMini_UpdateCurrentMode(GUI.mode.car)
    elseif _ARG_0_ == UIEnums.Message.ButtonX then
      UISystem.PlaySound(UIEnums.SoundEffect.GarageReSpray)
      GUI.save_on_exit = true
      GarageMini_ResprayRevert()
      GarageMini_UpdateCurrentMode(GUI.mode.car)
    end
  end
end
