    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_tier_locked, GarageMini_GetSelectedCar().boss_state == "tier_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_event_locked, GarageMini_GetSelectedCar().boss_state == "event_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_car_locked, GarageMini_GetSelectedCar().boss_state == "car_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_lock, GarageMini_GetSelectedCar().boss_state ~= "car_unlocked")
    AIGamerPicture(SCUI.name_to_id.sp_boss_pic, UIGlobals.boss_avatar_ids[GarageMini_GetSelectedCar().boss_tier])
    UIButtons.ChangeText(SCUI.name_to_id.sp_boss_name, GUI.sp_boss_info[GarageMini_GetSelectedCar().boss_tier].name)
    if GarageMini_GetSelectedCar().boss_state == "tier_locked" then
      UIButtons.ChangeText(SCUI.name_to_id.sp_boss_tier_locked_number, "GAME_NUM_" .. GUI.sp_tier_info[GarageMini_GetSelectedCar().boss_tier].starRequirement)
    end
    if GarageMini_GetSelectedCar().boss_state == "car_locked" then
      if GarageMini_GetSelectedCar().ability ~= -1 then
        UIButtons.ChangeText(SCUI.name_to_id.sp_boss_car_locked_title, UIText.RBC_UNLOCK_THIS_BOSS_CAR)
      else
        UIButtons.ChangeText(SCUI.name_to_id.sp_boss_car_locked_title, UIText.RBC_UNLOCK_THIS_BOSS_CAR_NO_MOD)
      end
    end
  else
  end
  if GarageMini_GetSelectedCar().own_it == true then
    UIButtons.ChangeText(SCUI.name_to_id.stat_style_text, GUI.style_names[GarageMini_GetSelectedCar().style])
    Amax.SetChickletsValue(SCUI.name_to_id.chick_acceleration, GarageMini_GetSelectedCar().acceleration)
    Amax.SetChickletsValue(SCUI.name_to_id.chick_speed, GarageMini_GetSelectedCar().speed)
    Amax.SetChickletsValue(SCUI.name_to_id.chick_off_road, GarageMini_GetSelectedCar().stability)
    Amax.SetChickletsValue(SCUI.name_to_id.chick_difficulty, GarageMini_GetSelectedCar().difficulty)
    Amax.SetChickletsValue(SCUI.name_to_id.chick_health, GarageMini_GetSelectedCar().strength)
