          UIButtons.ChangeColour(SCUI.name_to_id["repeat_offender_icon_" .. _FORV_8_], "Support_4")
        else
          UIButtons.ChangeColour(SCUI.name_to_id["repeat_offender_icon_" .. _FORV_8_], "Main_Black")
        end
      end
      GarageMini_UpdateColourUnlocks()
    end
    UIButtons.TimeLineActive("locked_on", false)
    UIButtons.TimeLineActive("boss_locked_on", false)
    UIButtons.TimeLineActive("stats_off", false)
