        UIButtons.ChangeText(SCUI.name_to_id.unlock_desc, "MPL_LEVEL_FANS_NEEDED" .. GUI.sp_rank_info[GUI.garage.rank[GarageMini_GetSelectedCar().id]].fans - GUI.sp_game_info.fans .. "_" .. GUI.garage.rank[GarageMini_GetSelectedCar().id])
      else
        UIButtons.ChangeText(SCUI.name_to_id.unlock_desc, "SPL_FANS_NEEDED" .. GUI.sp_rank_info[GUI.garage.rank[GarageMini_GetSelectedCar().id]].fans - GUI.sp_game_info.fans .. "_" .. GUI.garage.rank[GarageMini_GetSelectedCar().id])
      end
      UIButtons.ChangeSize(SCUI.name_to_id.unlock_progress, UIButtons.GetSize(SCUI.name_to_id.unlock_backing) * (GUI.sp_game_info.fans / GUI.sp_rank_info[GUI.garage.rank[GarageMini_GetSelectedCar().id]].fans), UIButtons.GetSize(SCUI.name_to_id.unlock_progress))
      UIButtons.TimeLineActive("boss_locked_on", false)
      UIButtons.TimeLineActive("locked_on", true)
    end
    UIButtons.TimeLineActive("stats_off", true)
  end
  if GUI.is_multiplayer == false and GUI.recommended ~= nil then
    if GUI.recommended[GarageMini_GetSelectedCar().id] ~= nil then
      UIButtons.TimeLineActive("recommended_on", true, 0)
    else
      UIButtons.TimeLineActive("recommended_on", false)
    end
  end
  GarageMini_UpdateCarInfoLines()
end
